import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  svgHover: {
    fill: theme.palette.foreground.default,
    "&:hover": {
      fill: theme.palette.primary.main,
    },
    transition: "all 0.5s ease",
  },
}));

export const Logo = () => {
  const classes = useStyles();

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 300 200" // Aumentei a largura do viewBox para criar espaço entre as letras
      className={classes.svgHover}
    >
      {/* Letra R */}
      <rect className="cls-1" x="30" y="40" width="10" height="120" rx="5" />
      <rect className="cls-1" x="30" y="40" width="100" height="10" rx="5" />
      <rect className="cls-1" x="30" y="90" width="70" height="10" rx="5" />
      <rect className="cls-1" x="100" y="90" width="10" height="30" rx="5" />

      {/* Espaço entre as letras */}
      <rect x="170" y="40" width="20" height="130" fill="transparent" />

      {/* Letra P */}
      <rect className="cls-1" x="190" y="40" width="10" height="120" rx="5" />
      <rect className="cls-1" x="190" y="40" width="60" height="10" rx="5" />
      <rect className="cls-1" x="250" y="40" width="10" height="50" rx="5" />
      <rect className="cls-1" x="190" y="90" width="60" height="10" rx="5" />
    </svg>
  );
};
